const mongoose = require('mongoose');
const Schema = mongoose.Schema;
const ObjectId=Schema.ObjectId
const User = new Schema({
    id: ObjectId,
    email: {
        type:String,
        required: true,
        unique: true
    },
    login:{
        type: String,
        default: "",
    },
    password: {
        type:String,
        required: true
    },
    role:{
        type: "String",
        default: 'user'
    },
    avatar: {
        type: String,
        default: 'data:image/png;base64,'
    },
    registrationDate: {
        type: Date,
        required: true
    }
});

module.exports = mongoose.model('User', User);
